extractFakeContributions::extractFakeContributions(TTree *tree) : fChain(0) 
{
// if parameter tree is not specified (or zero), connect the file
// used to generate this class and read the Tree.
   if (tree == 0) {
      TFile *f = (TFile*)gROOT->GetListOfFiles()->FindObject("root://cmseos.fnal.gov//store/user/skaplan/noreplica/FINALNTUPLES/DoubleEG/crab_DoubleEG__Run2016E-03Feb2017-v1__MINIAOD/170505_201721/0000/out_DoubleEG_Run2016E-03Feb2017-v1_numEvent100_21.root");
      if (!f || !f->IsOpen()) {
         f = new TFile("root://cmseos.fnal.gov//store/user/skaplan/noreplica/FINALNTUPLES/DoubleEG/crab_DoubleEG__Run2016E-03Feb2017-v1__MINIAOD/170505_201721/0000/out_DoubleEG_Run2016E-03Feb2017-v1_numEvent100_21.root");
      }
      TDirectory * dir = (TDirectory*)f->Get("root://cmseos.fnal.gov//store/user/skaplan/noreplica/FINALNTUPLES/DoubleEG/crab_DoubleEG__Run2016E-03Feb2017-v1__MINIAOD/170505_201721/0000/out_DoubleEG_Run2016E-03Feb2017-v1_numEvent100_21.root:/diphoton");
      dir->GetObject("fTree",tree);

   }
   Init(tree);
}

extractFakeContributions::~extractFakeContributions()
{
   if (!fChain) return;
   delete fChain->GetCurrentFile();
}

Int_t extractFakeContributions::GetEntry(Long64_t entry)
{
// Read contents of entry.
   if (!fChain) return 0;
   return fChain->GetEntry(entry);
}
Long64_t extractFakeContributions::LoadTree(Long64_t entry)
{
// Set the environment to read one entry
   if (!fChain) return -5;
   Long64_t centry = fChain->LoadTree(entry);
   if (centry < 0) return centry;
   if (fChain->GetTreeNumber() != fCurrent) {
      fCurrent = fChain->GetTreeNumber();
      Notify();
   }
   return centry;
}

void extractFakeContributions::Init(TTree *tree)
{
   // The Init() function is called when the selector needs to initialize
   // a new tree or chain. Typically here the branch addresses and branch
   // pointers of the tree will be set.
   // It is normally not necessary to make changes to the generated
   // code, but the routine can be extended by the user if needed.
   // Init() will be called many times when running on PROOF
   // (once per file to be processed).

   // Set branch addresses and branch pointers
   if (!tree) return;
   fChain = tree;
   fCurrent = -1;
   fChain->SetMakeClass(1);

   fChain->SetBranchAddress("Event", &Event_run, &b_Event);
   fChain->SetBranchAddress("BeamSpot", &BeamSpot_x0, &b_BeamSpot);
   fChain->SetBranchAddress("Vertex0", &Vertex0_vx, &b_Vertex0);
   fChain->SetBranchAddress("PrimaryVertex", &PrimaryVertex_vx, &b_PrimaryVertex);
   fChain->SetBranchAddress("Jet", &Jet_jetHT, &b_Jet);
   fChain->SetBranchAddress("TriggerBit", &TriggerBit_HLT_AK4PFDJet60_Eta2p1ForPPRef, &b_TriggerBit);
   fChain->SetBranchAddress("TriggerPrescale", &TriggerPrescale_HLT_AK4PFDJet60_Eta2p1ForPPRef, &b_TriggerPrescale);
   fChain->SetBranchAddress("Photon1", &Photon1_pt, &b_Photon1);
   fChain->SetBranchAddress("Photon2", &Photon2_pt, &b_Photon2);
   fChain->SetBranchAddress("GenPhoton1", &GenPhoton1_pt, &b_GenPhoton1);
   fChain->SetBranchAddress("GenPhoton2", &GenPhoton2_pt, &b_GenPhoton2);
   fChain->SetBranchAddress("Diphoton", &Diphoton_Minv, &b_Diphoton);
   fChain->SetBranchAddress("GenDiphoton", &GenDiphoton_Minv, &b_GenDiphoton);
   fChain->SetBranchAddress("TTPhoton1", &TTPhoton1_pt, &b_TTPhoton1);
   fChain->SetBranchAddress("TTPhoton2", &TTPhoton2_pt, &b_TTPhoton2);
   fChain->SetBranchAddress("TTDiphoton", &TTDiphoton_Minv, &b_TTDiphoton);
   fChain->SetBranchAddress("TFPhoton1", &TFPhoton1_pt, &b_TFPhoton1);
   fChain->SetBranchAddress("TFPhoton2", &TFPhoton2_pt, &b_TFPhoton2);
   fChain->SetBranchAddress("TFDiphoton", &TFDiphoton_Minv, &b_TFDiphoton);
   fChain->SetBranchAddress("FTPhoton1", &FTPhoton1_pt, &b_FTPhoton1);
   fChain->SetBranchAddress("FTPhoton2", &FTPhoton2_pt, &b_FTPhoton2);
   fChain->SetBranchAddress("FTDiphoton", &FTDiphoton_Minv, &b_FTDiphoton);
   fChain->SetBranchAddress("FFPhoton1", &FFPhoton1_pt, &b_FFPhoton1);
   fChain->SetBranchAddress("FFPhoton2", &FFPhoton2_pt, &b_FFPhoton2);
   fChain->SetBranchAddress("FFDiphoton", &FFDiphoton_Minv, &b_FFDiphoton);
   fChain->SetBranchAddress("isGood", &isGood, &b_isGood);
   fChain->SetBranchAddress("isTT", &isTT, &b_isTT);
   fChain->SetBranchAddress("isTF", &isTF, &b_isTF);
   fChain->SetBranchAddress("isFT", &isFT, &b_isFT);
   fChain->SetBranchAddress("isFF", &isFF, &b_isFF);
   fChain->SetBranchAddress("nPV", &nPV, &b_nPV);
   Notify();
}

Bool_t extractFakeContributions::Notify()
{
   // The Notify() function is called when a new file is opened. This
   // can be either for a new TTree in a TChain or when when a new TTree
   // is started when using PROOF. It is normally not necessary to make changes
   // to the generated code, but the routine can be extended by the
   // user if needed. The return value is currently not used.

   return kTRUE;
}

